"text": "<div>\n<i class=\"NoteType\">\nTapahtuman lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKummit: talollisen poika Tuomas Hiiri ja palvelija Anna Kivipelto sek\u00e4 lois Johannes Hiiri ja (Elman is\u00e4n) sisar Katrina (joka oli Ilmi Tomperin \u00e4iti)\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
